import React, { Component } from 'react';
import { connect } from 'react-redux';
import {fetchResults} from '../../dispatchers/resultsDispatch'

class History extends Component{

    retroSearch(e){
        this.props.fetchResults(e.target.id);
    }
    render(){
        const {searches} = this.props;
        return(
            <div>
                <div>
                    <div>
                        <h1>History</h1>
                    </div>
                </div>
                <div>
                    <div>
                        <p>Click on previous for retroacrtive searches</p>
                        {
                            searches.map(search=>{
                                return(
                                    <button id={search} key={search} onClick={this.retroSearch}>
                                        {search}
                                    </button>
                                )
                            })
                        }
                    </div>
                </div>
            </div>
        )
    }
}
const mapStateToProps = (state) =>{
    return{
        searches: state.searches
    }
}
const mapDispatchToProps = (dispatch)=>{
    return{
        fetchResults: (query)=>dispatch(fetchResults(query))
    }
}

export default connect(mapStateToProps,mapDispatchToProps)(History)
